/* Biblioteca de Filmes */

create database locadora;
use locadora;

/*drop table filmes;
drop table generos;
drop table clientes;
drop table emprestimos;*/

create table GENEROS(
codigo_genero int PRIMARY KEY,
nome_genero char(15));


create table FILMES(
codigo_filme int PRIMARY KEY,
nome_filme char(60),
nome_original char(60),
cod_genero int references GENEROS (codigo_genero),
ano int,
valor decimal(7,2));

commit;

create table CLIENTES(
codigo_cliente int PRIMARY KEY,
nome_cliente char(42),
logradouro char(37),
numero int,
complemento char(8),
bairro char(20),
Cidade char(30),
UF char(2));

commit;

create table EMPRESTIMOS (
cod_filme int,
codigo_cliente int,
dt_empr date,
dt_dev date,
valor_empr decimal(7,2),
valor_multa decimal(7,2),
valor_desc decimal(7,2),
valor_total decimal(7,2),
PRIMARY KEY(cod_filme,cod_cliente,dt_empr),
FOREIGN KEY (cod_cliente) references CLIENTES(codigo_cliente),
FOREIGN KEY (cod_filme) references FILMES(codigo_filme));





-- Quantas pessoas emprestam filmes no ano de 2008: (Aninhado)

select dt_empr
from emprestimo
where YEAR (dt_empr) = 2008;

-- Junes entre tabelas:

select codigo_cliente
from clientes
left join emprestimos

-- Agregao:

select max (valor_total)
from emprestimos